import { __decorate } from "tslib";
import { Component } from '@angular/core';
import { TruncatePipe } from '../shared/trunc.pipe';
let WorksComponent = class WorksComponent {
    constructor(_projectService, router) {
        this._projectService = _projectService;
        this.router = router;
    }
    chooseProject(project) {
        this.router.navigate(['detail', project.id]);
    }
    ngOnInit() {
        this._projectService.getProjects().then((projects) => (this.projects = projects));
    }
};
WorksComponent = __decorate([
    Component({
        selector: 'app-works',
        templateUrl: './works.component.html',
        styleUrls: ['./works.component.scss'],
        pipes: [TruncatePipe],
    })
], WorksComponent);
export { WorksComponent };
